import './App.css';
import { Switch , Router,Route} from 'react-router-dom'
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  return (
    <div className="App">

    <Router>
    <Navbar/>
      <Switch>
        <Route exact path="/">
          <Home/>
        </Route>
      </Switch>
    </Router>

    </div>
  );
}

export default App;
